//architectureofdoom.tumblr.com/post/41537604544/chiesa-di-santa-maria-della-visitazione-rome"},{"Text1":"Chiesa di Santa Maria della Visitazione, Rome, Italy","latitude":41.909858000000014,"longitude":12.551401000000014,"all_links":"http://architectureofdoom.tumblr.com/post/41733264783http://architectureofdoom.tumblr.com/post/41537265990http://architectureofdoom.tumblr.com/post/41537604544http://architectureofdoom.tumblr.com/post/74479745372","Multiple_Images_URL":"https://64.media.tumblr.com/60ae4ba2bb607a7bdf504e45216c7d58/tumblr_mh8wthNqY91r4vadxo2_500.jpg","Page_URL1":"https://architectureofdoom.tumblr.com/post/41537265990/chiesa-di-santa-maria-della-visitazione-rome","Single_Image_URL":"https://64.media.tumblr.com/f06c3d161899a4539579851f40e2082d/tumblr_mznohpLBaS1s3mr3po1_r1_500.jpg","Text":"2014/01/25\\n\\n    497 notes\\n\\n\\n        gregorgraf:Chiese Parr Visitazione di Maria SS. / Rome, ItalySaverio Busiri Vici, 1965-71. View this on the map(via ghostof) \\n\\n          \\n            Tags:\\n              \\n                 church\\n              \\n                 Rome\\n              \\n                 Italy\\n              \\n                 Busiri Vici\\n              \\n                 1960\'s","Image_URL1":"https://64.media.tumblr.com/f06c3d161899a4539579851f40e2082d/tumblr_mznohpLBaS1s3mr3po1_r1_500.jpg","Image_URL2":"","Page_URL":"https://architectureofdoom.tumblr.com/post/74479745372/gregorgraf-chiese-parr-visitazione-di-maria-ss"},{"Text1":"Former nuclear research facility, Orford Ness, England","latitude":52.07914300000001,"longitude":1.5525270000000146,"all_links":"http://architectureofdoom.tumblr.com/post/41546189243http://architectureofdoom.tumblr.com/post/74518895011http://architectureofdoom.tumblr.com/post/74519919722 http://architectureofdoom.tumblr.com/post/102682411763","Multiple_Images_URL":"","Page_URL1":"","Single_Image_URL":"https://64.media.tumblr.com/ee263fe95d886376b2ec3c120fec4a4f/tumblr_mh8rv7pBJD1r4vadxo1_500.jpg","Text":"2013/01/26\\n\\n    44 notes\\n\\n\\n        From Wastelands, Dan DubowitzDuring the 1950s the British Ministry of Defence built a nuclear research facility at Orford Ness, a 45 hectare natural pebble spit off the east coast of England. Laboratories with 15 feet thick concrete walls were constructed to vibration test, drop test, cook, spin and assemble nuclear weapons. Cobra Mist, a top secret Cold War eavesdropping programme was established on \u2018the island\u2019 using \'over the horizon\u2019 backscatter radar to listen in on the Soviets. Other laboratories were devoted to centrifuge, the original testing machine was later moved to AWE Aldermaston, where it is still in use. The structures most shrouded in secrecy were the \'pagodas\u2019 used for mechanical and vibration testing. Their massive roofs, piled high with pebbles for extra mass, are supported on impossibly slender columns. In a nuclear blast it was planned they would give way and cap the bunker to contain an explosion.As the Cold War ended the need for Orford Ness diminished and the M.O.D. decommissioned the site and gave it to the National Trust, but not before they tested some of their samples and the labs to destruction. The enormous steel armoured doors were blown off Lab3, known as \'the oven\u2019. The control room is filled with a strange ash, in which wild hares have built a warren.View this on the map(Source: civicworks.net) \\n\\n          \\n            Tags:\\n              \\n                 Architecture\\n              \\n                 military\\n              \\n                 abandoned\\n              \\n                 bunker\\n              \\n                 England","Image_URL1":"https://64.media.tumblr.com/ee263fe95d886376b2ec3c120fec4a4f/tumblr_mh8rv7pBJD1r4vadxo1_500.jpg","Image_URL2":"","Page_URL":"https://architectureofdoom.tumblr.com/post/41546189243/from-wastelands-dan-dubowitz-during-the-1950s"},{"Text1":"Former nuclear research facility, Orford Ness, England","